{

    internal InnerEndpointConfigClarifyInferenceConfigFactory InferenceConfigFactory { get; set; }

    internal InnerEndpointConfigClarifyShapConfigFactory ShapConfigFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointConfigTypes.ClarifyExplainerConfig Create()
    {
        var clarifyExplainerConfigResult = CreateClarifyExplainerConfig();
        factoryAction?.Invoke(clarifyExplainerConfigResult);

        return clarifyExplainerConfigResult;
    }

    private Humidifier.SageMaker.EndpointConfigTypes.ClarifyExplainerConfig CreateClarifyExplainerConfig()
    {
        var clarifyExplainerConfigResult = new Humidifier.SageMaker.EndpointConfigTypes.ClarifyExplainerConfig();

        return clarifyExplainerConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointConfigTypes.ClarifyExplainerConfig result)
    {
        base.CreateChildren(result);

        result.InferenceConfig ??= InferenceConfigFactory?.Build();
        result.ShapConfig ??= ShapConfigFactory?.Build();
    }

} // End Of Class

